import "./Footer.css";
import React from "react";
import { Link } from "react-router-dom";
import {
  FaFacebook,
  FaTwitter,
  FaInstagram,
  FaLinkedin,
  FaPinterest,
  FaEnvelope,
  FaAmbulance,
  FaDiagnoses,
  FaHeartbeat,
  FaBlog,
} from "react-icons/fa";
import { RiPsychotherapyFill } from "react-icons/ri";
import { BiBody } from "react-icons/bi";
import {
  FcCallback,
  FcGlobe,
  FcVoicemail,
  FcCellPhone,
  FcHome,
  FcServices,
  FcAbout,
  FcManager,
  FcCheckmark,
  FcComments,
} from "react-icons/fc";

const Footer = () => {
  return (
    <section className="footer">
      <div className="box-container">
        <div className="box">
          <h3>quick links</h3>
          <Link to="/home">
            {" "}
            <i className="fas fa-chevron-right">
              <FcHome></FcHome>
            </i>{" "}
            home{" "}
          </Link>
          <Link to="/services">
            {" "}
            <i className="fas fa-chevron-right">
              {" "}
              <FcServices></FcServices>{" "}
            </i>{" "}
            services{" "}
          </Link>
          <Link to="/about">
            {" "}
            <i className="fas fa-chevron-right">
              {" "}
              <FcAbout></FcAbout>{" "}
            </i>{" "}
            about{" "}
          </Link>
          <Link to="/doctors">
            {" "}
            <i className="fas fa-chevron-right">
              <FcManager></FcManager>
            </i>{" "}
            doctors{" "}
          </Link>
          <Link to="/book">
            {" "}
            <i className="fas fa-chevron-right">
              {" "}
              <FcCheckmark></FcCheckmark>{" "}
            </i>{" "}
            book{" "}
          </Link>
          <Link to="/review">
            {" "}
            <i className="fas fa-chevron-right">
              <FcComments></FcComments>
            </i>{" "}
            review{" "}
          </Link>
          <Link to="/blogs">
            {" "}
            <i className="fas fa-chevron-right">
              <FaBlog></FaBlog>
            </i>{" "}
            Service{" "}
          </Link>
        </div>

        <div className="box">
          <h3>our services</h3>
          <Link to="#">
            {" "}
            <i className="fas fa-chevron-right">
              {" "}
              <BiBody></BiBody>{" "}
            </i>{" "}
            Electrocardiography
{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fas fa-chevron-right">
              {" "}
              <RiPsychotherapyFill></RiPsychotherapyFill>{" "}
            </i>{" "}
            Ultrasonography{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fas fa-chevron-right">
              {" "}
              <FaHeartbeat></FaHeartbeat>{" "}
            </i>{" "}
            Computed Tomography Scan{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fas fa-chevron-right">
              {" "}
              <FaDiagnoses></FaDiagnoses>{" "}
            </i>{" "}
            diagnosis{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fas fa-chevron-right">
              {" "}
              <FaAmbulance></FaAmbulance>{" "}
            </i>{" "}
            ambulance service{" "}
          </Link>
        </div>

        <div className="box">
          <h3>contact info</h3>
          <Link to="#">
            {" "}
            <i className="fas fa-phone">
              {" "}
              <FcCallback></FcCallback>{" "}
            </i>{" "}
            01777777771{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fas fa-phone">
              <FcCellPhone></FcCellPhone>{" "}
            </i>{" "}
            +891907967687{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fas fa-envelope">
              {" "}
              <FaEnvelope></FaEnvelope>{" "}
            </i>{" "}
            sekhhasina.care@gmail.com{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fas fa-envelope">
              {" "}
              <FcVoicemail></FcVoicemail>
            </i>{" "}
            sekhhasina.mail@gmail.com{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fas fa-map-marker-alt">
              {" "}
              <FcGlobe></FcGlobe>{" "}
            </i>{" "}
            Tangail, Bangladesh - 1215{" "}
          </Link>
        </div>

        <div className="box">
          <h3>follow us</h3>
          <Link to="#">
            {" "}
            <i className="fab fa-facebook-f">
              <FaFacebook></FaFacebook>
            </i>{" "}
            facebook{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fab fa-twitter">
              <FaTwitter></FaTwitter>
            </i>{" "}
            twitter{" "}
          </Link>

          <Link to="#">
            {" "}
            <i className="fab fa-instagram">
              {" "}
              <FaInstagram></FaInstagram>{" "}
            </i>{" "}
            instagram{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fab fa-linkedin">
              {" "}
              <FaLinkedin></FaLinkedin>{" "}
            </i>{" "}
            linkedin{" "}
          </Link>
          <Link to="#">
            {" "}
            <i className="fab fa-pinterest">
              <FaPinterest></FaPinterest>{" "}
            </i>{" "}
            pinterest{" "}
          </Link>
        </div>
      </div>

      <div className="credit">
      © Kabir Hossen Akash 2021. Developed with <span className="love">❤</span> . by <a href="https://www.facebook.com/talukderakash4420">Akash</a> .
      </div>
    </section>
  );
};

export default Footer;
